import styled from 'styled-components';
export default function HabitList({days,id,name}){
    console.log(name);
    return(
    <RegisterHabits>
        <Days pointer = {pointerEvent}>
            <Button id="0" >D</Button>
            <Button id="1" >S</Button>
            <Button id="2" >T</Button>
            <Button id="3" >Q</Button>
            <Button id="4" >Q</Button>
            <Button id="5" >S</Button>
            <Button id="6" >S</Button>
        </Days>
    </RegisterHabits>
    )
}

const RegisterHabits = styled.div`
    background: #FFFFFF;
    border-radius: 5px;
    padding: 19px;
    display: ${props => props.createHabits};
`;

const Days = styled.div`
    margin-bottom: 30px;
    pointer-events: ${props => props.pointer};
    .selected{
        background-color: #CFCFCF;
        color: #FFFFFF;
    }
`;

const Button = styled.button`
    width: 30px;
    height: 30px;

    background-color: #FFFFFF;
    border: 1px solid #D5D5D5;
    border-radius: 5px;

    font-size: 20px;
    color: #DBDBDB;

    margin:8px 4px 0 0;
`
